import React from 'react';
import { KnightWhite,  Destination, Knight } from './Icon';
import './Board.scss';



class Board extends React.Component {
    constructor(props) {
        super(props);
        this.boardSize = 8;
        this.boardElements = [];
    }

    componentDidMount() {
      this.init();
    }

    init = () => {
      this.boardElements = [0,1,2,3,4,5,6,7];
    }

    render() {
        return (
          <ul>
            {this.boardElements.map(index=> 
              <li key={index}>
                <ul>
                  {this.boardElements.map(childIndex => 
                    <li key={`${index}-${childIndex}`}></li>
                  )}
                </ul>
              </li>
            )}
          </ul>
        ) 
    }
}

export default Board;
